import Card from "../UI/Card";
import classes from "./AvailableMeals.module.css";
import MealItem from "./MealItem/MealItem";
const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Chicken Biryani",
    description: "A Pakistan specialty!",
    price: 400,
  },
  {
    id: "m2",
    name: "Karahi",
    description: "Traditionally, meat would be simmered.",
    price: 1700,
  },
  {
    id: "m3",
    name: "Barbecue Burger",
    description: "A burger is a patty of ground beef grilled.",
    price: 550,
  },
  {
    id: "m4",
    name: "Chapli Kebab",
    description: "Thin ground beef patties made with aromatics and spices..",
    price: 100,
  },
];

const AvailableMeals = () => {
  const mealslist = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));
  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealslist}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
